import { StyleSheet } from "react-native";

import { Layout, Font, Colors } from "style";

export default StyleSheet.create({
  container: {
    ...Layout.containerWithGradient,
  },
  background:{
    flex:1,
    backgroundColor:Colors.skyblue
  }
});
